INSERT INTO `ga_noticias` (`id`, `titulo`, `desarrollo`, `fecha`, `posicion`, `idTorneoCat`) VALUES
(20, 'Convenio de Entrenamiento con el Club A. Fénix', 'Gambeta Femenina ha realizado un convenio con el Club Atlético Fenix de Colegiales, que a partir del mes de Octubre abrió su Escuela de Formación y Entrenamiento de Fútbol Femenino!<br><br>\r\n\r\nLa Escuela ya cuenta con más de 50 chicas inscriptas, dando la posibildad de entrenar hasta 3 días por semana: Lunes, Miércoles y/o Jueves en el horario de 20 a 22 hs!<br><br>\r\n\r\nLos entrenamientos comprenden parte física, táctica y técnica. Asimismo, cuenta con asistencia de cuerpo médico y nutrición en algunos entrenamientos y previo a las competiciones del Club.<br><br>\r\n\r\nLa Escuela de formación está destinada a todas las chicas que quieran jugar al fútbol! Sin importar el nivel ni la edad!! <br><br>\r\n\r\nAsimismo, El Club Fenix comenzará a competir en Fútbol 11 y Futsal de AFA, por lo que también formará los planteles para las actividades del 2012!<br><br>\r\n\r\nDesde Octubre ya comenzaron los entrenamientos en el barrio de Colegiales!! Si te querés sumar, escribinos a Fenixfutbolfemenino@gmail.com. Te esperamos!!!', '2011-12-27', 0, 0),
(23, 'Pretemporada Gambetera Verano 2012!', 'Porque acompañamos al Fútbol Femenino desde 2006, sabemos que esta Pasión no se toma vacaciones! Por eso, ya comienza la Pretemporada Gambetera 2012!! <br><br>\r\nDurante Enero y Febrero, todos los sábados y domingos por la tarde, estaremos realizando Torneos Relámpagos, partidos amistosos y Copas Desafío de un solo día!! Empezá a prepararte para el Clausura 2012!! <br><br>\r\nCada fin de semana se renovarán las ilusiones, las ganas de jugar y la lucha por el primer título del año!! Que la pelota no pare de rodar! A recibir el 2012 a puro fútbol!! <br><br>\r\nInformes e inscripción en: info@gambetafemenina.com.ar\r\n', '2011-12-27', 1, 0),
(24, 'Cronograma', 'Chicas! Les informamos que este viernes 1/7 no habrá fecha debido al debut de la Selección Argentina en la Copa América. <br>\r\nLos partidos programados para tal día se jugarán el día viernes 28 de Octubre en los mismos horarios. <br><br>\r\nPara una mejor comprensión de los horarios y cronograma de partidos, se ha enviado a la capitana y referente de cada equipo el Fixture completo de La Liga. <br><br>\r\nA partir del conocimiento con antelación de los mismos, no se podrán garantizar modificaciones de días u horarios con posterioridad al partido inmediato anterior a que se juegue la fecha en cuestión, pudiéndose otorgar los puntos al equipo rival.\r\n', '2011-06-29', 0, 1),
(30, 'Convenio de Entrenamiento con el Club A. Fenix', 'Gambeta Femenina ha realizado un convenio con el Club Atlético Fenix de Colegiales, que a partir del mes de Octubre abrió su Escuela de Formación y Entrenamiento de Fútbol Femenino!<br><br>\r\n\r\nLa Escuela ya cuenta con más de 50 chicas inscriptas, dando la posibildad de entrenar hasta 3 días por semana: Lunes, Miércoles y/o Jueves en el horario de 20 a 22 hs!<br><br>\r\n\r\nLos entrenamientos comprenden parte física, táctica y técnica. Asimismo, cuenta con asistencia de cuerpo médico y nutrición en algunos entrenamientos y previo a las competiciones del Club.<br><br>\r\n\r\nLa Escuela de formación está destinada a todas las chicas que quieran jugar al fútbol! Sin importar el nivel ni la edad!! <br><br>\r\n\r\nAsimismo, El Club Fenix comenzará a competir en Fútbol 11 y Futsal de AFA, por lo que también formará los planteles para las actividades del 2012!<br><br>\r\n\r\nDesde Octubre ya comenzaron los entrenamientos en el barrio de Colegiales!! Si te querés sumar, escribinos a Fenixfutbolfemenino@gmail.com. Te esperamos!!!', '2011-10-12', 1, 13),
